                    List<Dynamic_SP_Params> _Params = new List<Dynamic_SP_Params>();
                    _Params.Add(new Dynamic_SP_Params { ParameterName = "PR_ID", Val = PR_ID });
                    string query = @" SELECT prd_H.Report_Header_Text, prd_H.Report_Header_Value FROM [dbo].[T_Patient_Report_Detail] prd_H WITH (NOLOCK) WHERE prd_H.PR_ID = @PR_ID AND prd_H.IsActive = 1 AND prd_H.Report_Header_Text is not null AND prd_H.Report_Header_Value is not null";
                    result = StaticPublicObjects.ado.P_Get_Generic_List_SP<Patient_Report_Section_Header>(query, ref _Params, false);
