        public P_Get_Patient_Report_Detail P_Get_Patient_Report_Detail(int PR_ID)
        {
            P_Get_Patient_Report_Detail result = new P_Get_Patient_Report_Detail();
            try
            {
                if (PR_ID > 0)
                {
                    List<Dynamic_SP_Params> _Params = new List<Dynamic_SP_Params>()
                    {
                        new Dynamic_SP_Params {ParameterName = "PR_ID", Val = PR_ID}
                    };

                    string query = @"SELECT rt.Report_Template_Html
FROM [dbo].[T_Patient_Report] pr WITH (NOLOCK)
INNER JOIN [dbo].[T_Report_Templates] rt WITH (NOLOCK) ON pr.RT_ID = rt.RT_ID AND rt.IsActive = 1
WHERE pr.PR_ID = @PR_ID AND pr.IsActive = 1";
                    var Report_Template_Html = StaticPublicObjects.ado.Get_SingleRow_String_Result(query, _Params, false);

                    var json = StaticPublicObjects.ado.Get_SingleRow_String_Result("P_Get_Patient_Report_Detail", _Params, true);
                    if (!string.IsNullOrWhiteSpace(json))
                    {
                        result = JsonConvert.DeserializeObject<P_Get_Patient_Report_Detail>(json)!;
                        if (result != null)
                        {
                            result.Report_Template_Html = Report_Template_Html;
                        }
                    }

                }
            }
            catch (Exception ex)
            {
                StaticPublicObjects.logFile.ErrorLog(FunctionName: "P_Get_Patient_Report_Detail", SmallMessage: ex.Message, Message: ex.ToString());
            }

            return result;
        }
