        public S_Dropdown_List_Str Get_DropdownHtmlStringList(string query, List<Dynamic_SP_Params>? parms = null)
        {
            List<SelectDropDownList> List = new List<SelectDropDownList>();
            if (parms is null)
            {
                List = StaticPublicObjects.ado.Get_DropDownList_Result(query);
            }
            else
            {
                List = StaticPublicObjects.ado.Get_DropDownList_Result(query, parms);
            }
            var Options = string.Join("", List.Select(x => $"<option value='{x.code}'>{x.name}</option>"));
            S_Dropdown_List_Str obj = new S_Dropdown_List_Str()
            {
                Drop_List = List,
                Drop_Options = Options,
            };

            return obj;
        }
