        public Task<string> GetPatientReportHTML(int PatientReportID)
        {
            try
            {
                P_Get_Patient_Report_Detail prd = P_Get_Patient_Report_Detail(PatientReportID);

                string report_logo = "data:image/png;base64,";
                string template = prd.Report_Template_Html;

                // Compile the template
                var templateEngine = Handlebars.Compile(template);


                var data = new
                {
                    report_logo = report_logo,
                    report_title = prd.Report_Title,
                    doctor_name = prd.Doctor_Name,
                    patient_name = prd.Patient_Name,
                    mr_number = prd.MR,
                    date = prd.Date,
                    age_gender = prd.AgeGender,
                    viral_status = prd.ViralStatus,
                    performed_by = prd.Doctor_Name,
                    indication = prd.Indication,
                    report_header_section_types = GenerateReportHeaderSectionTypes(prd.Patient_Report_Section_Header),
                    report_body_section = GenerateReportBodySection(prd.Patient_Report_Section_Body)
                };

                var html = templateEngine(data);
                return Task.FromResult(html);
            }
            catch (HandlebarsDotNet.HandlebarsException ex)
            {
                Console.WriteLine($"HandlebarsException: {ex}");
                throw;
            }
            catch (Exception ex)
            {
                // Handle general exceptions
                Console.WriteLine($"An error occurred: {ex.Message}");
                throw;
            }
        }
        public string GenerateReportHeaderSectionTypes(List<Patient_Report_Section_Header>? header)
        {
            var sb = new StringBuilder();

            if (header == null)
                return sb.ToString();

            foreach (var item in header)
            {
                if (item.Report_Header_Value)
                {

                    sb.AppendLine($"<strong>{item.Report_Header_Text}:</strong><span class='box filled'></span>");
                }
                else
                {
                    sb.AppendLine($"<strong>{item.Report_Header_Text}:</strong><span class='box'></span>");
                }
            }
            return sb.ToString();
        }
        public string GenerateReportBodySection(List<Patient_Report_Section_Body>? body)
        {
            var sb = new StringBuilder();

            if (body == null)
                return sb.ToString();

            foreach (var item in body)
            {
                sb.AppendLine($"<h2>{item.Report_Body_Text}:</h2>");
                sb.AppendLine($"<p>{item.Report_Body_Value}</p>");
            }
            return sb.ToString();
        }
        public Task<byte[]> CreatePatientReportPDF(string PatientContantHtml)
        {
            try
            {
                HtmlToPdf converter = new HtmlToPdf();
                converter.Options.PdfPageSize = PdfPageSize.A4;
                converter.Options.PdfPageOrientation = PdfPageOrientation.Portrait;

                // Set the page margins
                //converter.Options.MarginTop = 20;
                converter.Options.MarginBottom = 20;
                converter.Options.MarginLeft = 20;
                converter.Options.MarginRight = 20;

                // Set additional options
                converter.Options.DisplayHeader = false;
                converter.Options.DisplayFooter = true;

                // Customize header and footer
                //converter.Header.DisplayOnFirstPage = true;
                //converter.Header.DisplayOnOddPages = true;
                //converter.Header.DisplayOnEvenPages = true;
                //converter.Header.Height = 50;
                //converter.Header.Add(new PdfHtmlSection("<h1>Patient Report</h1>", ""));

                converter.Footer.DisplayOnFirstPage = true;
                converter.Footer.DisplayOnOddPages = true;
                converter.Footer.DisplayOnEvenPages = true;
                
                // Create the first line with the signature placeholder
                string signatureText = "Consultant Signature____________________________________";
                PdfTextSection signatureSection = new PdfTextSection(0, 10, signatureText, new System.Drawing.Font("Arial", 15));
                converter.Footer.Add(signatureSection);

                // Create the second line with the page number and additional info
                converter.Footer.Height = 50;
                string pageInfoText = "Page: {page_number} of {total_pages} | Developed By : AJ CodeToCure Technologies | Contact Us: 0332-2559502";
                PdfTextSection pageInfoSection = new PdfTextSection(0, 30, pageInfoText, new System.Drawing.Font("Arial", 10));
                converter.Footer.Add(pageInfoSection);


                // Set the footer page numbers format
                //converter.Options.Footer.PageNumberFormat = "{page_number} of {total_pages}";

                PdfDocument doc = converter.ConvertHtmlString(PatientContantHtml);
                byte[] pdf = doc.Save();
                doc.Close();

                return Task.FromResult(pdf);
            }
            catch (Exception ex)
            {
                StaticPublicObjects.logFile.ErrorLog(FunctionName: "CreatePatientReportPDF", SmallMessage: ex.Message, Message: ex.ToString());
            }
            return Task.FromResult(new byte[0]);
        }

